 Your privacy is important to WWW.BJP.ORG (hereinafter referred to as the “website”). This privacy statement provides information about the personal information that the website collects, and the ways in which the website uses that personal information.Personal information collectionThe website may collect and use the following kinds of personal information:

information about your use of this website (including browsing patterns and behaviour);
information that you provide using for the purpose of registering with the website (including contact details);
information about transactions carried out over this website;
information that you provide for the purpose of subscribing to the website services (including SMS and email alerts); and any other information that you send to fellow users and webmaster.

Using personal informationThe website may use your personal information to:

administer this website;
personalize the website for you;
enable your access to and use of the website services;
publish information about you on the website;
send you marketing communications.

Where the website discloses your personal information to its agents or sub-contractors for these purposes, the agent or sub-contractor in question will be obligated to use that personal information in accordance with the terms of this privacy statement.In addition to the disclosures reasonably necessary for the purposes identified elsewhere above, the website may disclose your personal information to the extent that it is required to do so by law, in connection with any legal proceedings or prospective legal proceedings, and in order to establish, exercise or defend its legal rights.Securing of your dataThe website will take reasonable technical and organisational precautions to prevent the loss, misuse or alteration of your personal information.The website will store all the personal information you provide on its secure servers.Cross-border data transfersInformation that the website collects may be stored and processed in and transferred between any of the countries in which the website operates to enable the use of the information in accordance with this privacy policy.In addition, personal information that you submit for publication on the website will be published on the internet and may be available around the world.You agree to such cross-border transfers of personal information.Updating this statementThe website may update this privacy policy by posting a new version on this website.You should check this page occasionally to ensure you are familiar with any changes.Other websitesThis website contains links to other websites.The website is not responsible for the privacy policies or practices of any third party.Contact WebmasterIf you have any questions about this privacy policy or the website’s treatment of your personal information, please write to:Webmaster11, Ashoka RoadNew Delhi 110001This privacy statementThis privacy statement is based on an original template created by website-contracts.co.uk and distributed by freenetlaw.com
